    false,nt"url": null,nt"notes": "This annual narrative report for Minnesota
    Valley National Wildlife Refuge summarizes refuge activities during the 1993 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.   Land acquisition including fee titles and easements are also covered.
     The report includes a planning section which discusses management plans, compliance
    and research.  Refuge administration is outlined; information about personnel, youth
    programs, funding, and safety is given.  Habitat management is also covered.  Subjects
    include wetlands, grasslands, pest control, fire management and wilderness areas.
     The wildlife section of the report discusses wildlife diversity, water birds,
    raptors, banding, fisheries resources, and animal control.  The public uses of the
    refuge described in this report include recreational use, refuge visitation, interpretive
    programs, trapping, and law enforcement.  The equipment and facilities section of
    the report provides information about new construction, maintenance, and energy
    conservation.  Items of interest are provided at the end.",nt"license_title":
